import React from "react";
import Logo from "./images/git-logo.png";

export default function Header() {
    return(
        <header>
            <img src={Logo} />
            <nav>
                <ul>
                    <li>Home</li>
                    <li>Contact</li>
                    <li>Projects</li>
                </ul>
            </nav>
            <div className="area-button">
             <input type='' />
            </div>
        </header>
    )
}
